gtX(){return"Um mit dem Spielen zu beginnen, dr\xfccken Sie einfach die Schaltfl\xe4che 'Spiel starten' und w\xe4hlen Sie den Spielmodus aus (in dieser ersten Version ist nur der Einzelspielermodus verf\xfcgbar). Als N\xe4chstes k\xf6nnen Sie die Rolle ausw\xe4hlen, die Sie spielen m\xf6chten:\n\n"},
gtY(){return"Nachdem Sie Ihren Spielmodus ausgew\xe4hlt haben, k\xf6nnen Sie Ihr Spiel konfigurieren. Sie m\xfcssen eine kurze Beschreibung der Handlungsumgebung angeben, der Sie folgen m\xf6chten (einschlie\xdflich der Bedingung, das Spiel zu beenden), und Ihr Charakterblatt erstellen. Machen Sie sich keine Sorgen, wenn Sie damit keine Erfahrung haben; das Spiel kann ein Charakterblatt f\xfcr Sie generieren - es erledigt alles! (Derzeit generiert das Spiel nur automatisch erstellte Charakterbl\xe4tter.)\n\n"},
