gu_(){return"Dieser Teil ist wichtig. Da eine KI f\xfcr die Anleitung des Spiels verantwortlich ist und nicht ein Mensch, m\xfcssen sich alle Spieler verpflichten, bestimmte Richtlinien zu befolgen, um den Spielfluss zu erleichtern:\n\n"},
