gtX(){return"Pour commencer \xe0 jouer, appuyez simplement sur le bouton 'Commencer le jeu' et s\xe9lectionnez le mode de jeu (dans cette premi\xe8re version, seul le mode solo est disponible). Ensuite, vous pouvez choisir le r\xf4le que vous voulez jouer :\n\n"},
gtY(){return"Une fois que vous avez choisi votre mode de jeu, vous pouvez configurer votre partie. Vous devrez fournir une br\xe8ve description du contexte de l'histoire que vous souhaitez suivre (y compris la condition de fin du jeu) et cr\xe9er votre fiche de personnage. Ne vous inqui\xe9tez pas si vous n'avez pas d'exp\xe9rience \xe0 ce sujet ; le jeu peut g\xe9n\xe9rer une fiche de personnage pour vous, il fait tout ! (Actuellement, le jeu ne propose que des fiches de personnage g\xe9n\xe9r\xe9es automatiquement.)\n\n"},
gtZ(){return"Ensuite, si vous avez suffisamment de jetons pour jouer, vous pouvez commencer votre nouvelle campagne !\n\n"},
gu_(){return"Cette partie est importante. Comme c'est une IA qui est responsable de guider le jeu, et non un humain, tous les joueurs doivent s'engager \xe0 suivre certaines directives pour faciliter le d\xe9roulement du jeu :\n\n"},
gu0(){return"Respectez votre fiche de personnage : Souvenez-vous des d\xe9tails de votre personnage et int\xe9grez-les dans la conversation chaque fois que possible pour fournir plus de contexte \xe0 l'IA. Ne changez pas les d\xe9tails de votre personnage \xe0 moins d'y \xeatre invit\xe9.\n\n"},
gu1(){return"N'inventez pas les lancers de d\xe9s : Le m\xe9canisme naturel du jeu de r\xf4le est bas\xe9 sur les lancers de d\xe9s. Si on vous demande de faire un lancer, ne faites pas de valeurs invent\xe9es. Acceptez l'al\xe9atoire !\n\n"},
gu2(){return"Gardez l'IA dans le contexte : Nous vous faisons confiance pour suivre l'histoire fournie par l'IA. Apr\xe8s tout, elle n'est pas humaine. Corrigez lorsque n\xe9cessaire, prenez des d\xe9cisions que votre personnage prendrait et forgez votre propre chemin, mais ne vous \xe9garez pas dans des sujets non li\xe9s. Vous pourriez confondre l'IA et perturber le r\xe9cit.\n\n"},
gtT(){return"Pas de triche : Nous faisons appel \xe0 la bonne volont\xe9 de nos joueurs. Si les choses tournent mal, n'h\xe9sitez pas \xe0 aider l'IA \xe0 se souvenir de certaines d\xe9cisions et aspects de votre fiche de personnage.\n\n"},
gtU(){return"Comportez-vous comme avec votre Ma\xeetre de Jeu de confiance : Il incombe \xe0 chaque joueur de veiller \xe0 ce que le jeu soit agr\xe9able et facile \xe0 suivre.\n\n"},
