gpz(){return"N'h\xe9sitez pas \xe0 jouer la peur et le stress de votre personnage pendant les situations de panique. Cela ajoute de la profondeur \xe0 la narration et plonge les joueurs dans l'atmosph\xe8re du jeu.\n\n"},
