gqH(){return"Al nostro nucleo, siamo un gruppo dedicato di appassionati di giochi di ruolo che condividono un obiettivo comune: rendere il magico mondo dei giochi di ruolo accessibile a tutti. Crediamo che la magia della narrazione e delle avventure immersive debba essere alla portata di tutti coloro che bramano l'emozione di creare e intraprendere epiche missioni. Che tu sia un veterano esperto o un principiante completo, la nostra missione \xe8 fornire gli strumenti, l'orientamento e le risorse per aiutarti a immergerti nel coinvolgente mondo dei giochi di ruolo. Siamo qui per promuovere la creativit\xe0, accendere l'immaginazione e costruire una comunit\xe0 accogliente dove le meraviglie del gioco di ruolo sono celebrate."},
gqI(){return"Il nostro viaggio \xe8 alimentato da un amore radicato per la narrazione, un impegno per l'inclusivit\xe0 e il desiderio di connettersi con individui affini che condividono la nostra passione. Con una ricchezza di esperienza e un entusiasmo senza limiti, ci sforziamo di abbattere le barriere, semplificare la curva di apprendimento e permetterti di intraprendere le tue avventure uniche. Che tu sia un master del dungeon, un giocatore o semplicemente curioso di questo affascinante mondo, unisciti a noi in questa epica ricerca mentre cerchiamo di rendere i giochi di ruolo un'esperienza deliziosa e accessibile per tutti."},
