gtS(){return"Bem-vindo \xe0 se\xe7\xe3o de regras! Aqui, voc\xea aprender\xe1 rapidamente o que precisa para come\xe7ar e se divertir!\n\n"},
gtW(){return"Como jogar"},
gtX(){return"Para come\xe7ar a jogar, basta pressionar o bot\xe3o 'Iniciar Jogo' e selecionar o modo de jogo (neste primeira vers\xe3o, apenas o modo de jogador \xfanico est\xe1 dispon\xedvel). Em seguida, voc\xea pode escolher o papel que deseja desempenhar:\n\n"},
gtY(){return"Depois de escolher o modo de jogo, voc\xea pode configurar o seu jogo. Voc\xea precisar\xe1 fornecer uma breve descri\xe7\xe3o do cen\xe1rio da hist\xf3ria que deseja seguir (incluindo a condi\xe7\xe3o para encerrar o jogo) e criar a ficha do seu personagem. N\xe3o se preocupe se n\xe3o tiver experi\xeancia com isso; o jogo pode gerar uma ficha de personagem para voc\xea - ele faz tudo! (Atualmente, o jogo fornece apenas fichas de personagens geradas automaticamente.)\n\n"},
gtZ(){return"Depois disso, se tiver fichas suficientes para jogar, voc\xea pode iniciar sua nova campanha!\n\n"},
gu_(){return"Essa parte \xe9 importante. Como \xe9 uma IA respons\xe1vel por guiar o jogo, e n\xe3o um humano, todos os jogadores devem se comprometer a seguir certas diretrizes para facilitar o andamento do jogo:\n\n"},
gu0(){return"Aderir \xe0 sua ficha de personagem: Lembre-se dos detalhes do seu personagem e incorpore-os \xe0 conversa sempre que poss\xedvel para fornecer mais contexto \xe0 IA. N\xe3o mude os detalhes do seu personagem a menos que seja instru\xeddo a faz\xea-lo.\n\n"},
gu1(){return"N\xe3o invente rolagens de dados: O mecanismo natural para jogos de interpreta\xe7\xe3o de personagens s\xe3o as rolagens de dados. Se for solicitado a fazer uma rolagem, n\xe3o invente os valores. Aceite o acaso!\n\n"},
gu2(){return"Mantenha a IA no contexto: Confiamos em voc\xea para seguir a hist\xf3ria fornecida pela IA. Afinal, ela n\xe3o \xe9 humana. Corrija quando necess\xe1rio, tome decis\xf5es que seu personagem tomaria e trace seu pr\xf3prio caminho, mas n\xe3o se desvie para t\xf3picos n\xe3o relacionados. Voc\xea pode confundir a IA e interromper a narrativa.\n\n"},
gtT(){return"Sem trapa\xe7a: Apelamos \xe0 boa vontade dos nossos jogadores. Se as coisas sa\xedrem do controle, n\xe3o hesite em ajudar a IA a lembrar certas decis\xf5es e aspectos da ficha do seu personagem.\n\n"},
gtU(){return"Comporte-se como faria com seu Mestre de Jogo de confian\xe7a: \xc9 responsabilidade de cada jogador garantir que seja um jogo agrad\xe1vel e f\xe1cil de seguir.\n\n"},
